variables.value:
{
  title: {
    text: 'Waterfall Chart',
    subtext: 'Living Expenses in Shenzhen'
  },
  tooltip: {
    trigger: 'axis',
    axisPointer: {
      type: 'shadow'
    },
    formatter: function (params) {
      var tar = params[1];
      return tar.name + '<br/>' + tar.seriesName + ' : ' + JSObject4.fetchData().values1[tar.dataIndex];
    }
  },
  grid: {
    left: '3%',
    right: '4%',
    bottom: '3%',
    containLabel: true
  },
  xAxis: {
    type: 'category',
    splitLine: {
      show: false
    },
    data: JSObject4.fetchData().names
  },
  yAxis: {
    type: 'value'
  },
  series: [{
    name: 'Placeholder',
    type: 'bar',
    stack: 'Total',
    itemStyle: {
      borderColor: 'transparent',
      color: 'transparent'
    },
    emphasis: {
      itemStyle: {
        borderColor: 'transparent',
        color: 'transparent'
      }
    }
  }, {
    name: 'Life Cost',
    type: 'bar',
    stack: 'Total',
    label: {
      show: true,
      position: 'inside'
    },
    data: JSObject4.fetchData().values1
  }]
}
